import React from 'react'
import useStyles from './styles'
import {
  Avatar,
  button,
  Paper,
  Grid,
  Typography,
  Container,
} from '@material-ui/core'

const Auth = () => {
  const classes = useStyles()
  return (
    <Container component='main' maxWidth='xs'>
      <Paper className={classes.paper} elevation={3}></Paper>
    </Container>
  )
}

export default Auth
